import React from 'react';
import { Paper, Typography, Box, CircularProgress, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import CheckCircleOutlineIcon from '@mui/icons-material/CheckCircleOutline';

const RecoveryGoal = () => {
  const progress = 75; // Example progress value

  const goals = [
    "30 min cardio",
    "5 veg servings",
    "8h sleep",
    "10k steps"
  ];

  return (
    <Paper elevation={3} sx={{ p: 2, height: '300px', display: 'flex', flexDirection: 'column' }}>
      <Typography variant="h6" gutterBottom align="center">Recovery Goal</Typography>
      <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'center', mb: 1 }}>
        <Box sx={{ position: 'relative', display: 'inline-flex', mr: 2 }}>
          <CircularProgress variant="determinate" value={progress} size={60} />
          <Box
            sx={{
              top: 0,
              left: 0,
              bottom: 0,
              right: 0,
              position: 'absolute',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
            }}
          >
            <Typography variant="body2" component="div" color="text.secondary">
              {`${Math.round(progress)}%`}
            </Typography>
          </Box>
        </Box>
        <Typography variant="body2" align="center">Daily goals<br />completed</Typography>
      </Box>
      <List dense sx={{ width: '100%', maxWidth: 360, mx: 'auto', overflow: 'auto' }}>
        {goals.map((goal, index) => (
          <ListItem key={index} sx={{ px: 0, py: 0 }}>
            <ListItemIcon sx={{ minWidth: 36 }}>
              <CheckCircleOutlineIcon color="primary" fontSize="small" />
            </ListItemIcon>
            <ListItemText 
              primary={goal} 
              primaryTypographyProps={{ 
                variant: 'body2', 
                style: { whiteSpace: 'nowrap', overflow: 'hidden', textOverflow: 'ellipsis' } 
              }} 
            />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default RecoveryGoal;
